import React from 'react';
import styles from './style.scss';
import { PageContent, List, ListItem } from 'framework7-react';

const ManualSheet = ({ item }) => {
  const columns = [
    // {
    //   title: '收料单号',
    //   dataIndex: 'receiptNumber',
    //   key: 'receiptNumber',
    //   align: 'center',
    // },
    {
      title: '行号',
      dataIndex: 'lineNumber',
      key: 'lineNumber',
      align: 'center'
    },

    {
      title: '关联单号',
      dataIndex: 'associatedNumber',
      key: 'associatedNumber',
      align: 'center'
    },
    {
      title: '创建时间',
      dataIndex: 'createTime',
      key: 'createTime',
      align: 'center'
    },
    {
      title: '创建人',
      dataIndex: 'creator',
      key: 'creator',
      align: 'center'
    },
    {
      title: '单据数量',
      dataIndex: 'number',
      key: 'number',
      align: 'center'
    },
    {
      title: '单据物料编码',
      dataIndex: 'materialCode',
      key: 'materialCode',
      align: 'center'
    },
    {
      title: '单据物料名称',
      dataIndex: 'materialName',
      key: 'materialName',
      align: 'center'
    },
    {
      title: '托盘号',
      dataIndex: 'trayNumber',
      key: 'trayNumber',
      align: 'center'
    },
    {
      title: '规格',
      dataIndex: 'specifications',
      key: 'specifications',
      align: 'center'
    },
    {
      title: '实际重量',
      dataIndex: 'actualWeight',
      key: 'actualWeight',
      align: 'center'
    },
    {
      title: '实际数量',
      dataIndex: 'actualNumber',
      key: 'actualNumber',
      align: 'center'
    },
    {
      title: '实际物料编码',
      dataIndex: 'realityMaterialCode',
      key: 'realityMaterialCode',
      align: 'center'
    },
    {
      title: '实际物料名称',
      dataIndex: 'realityMaterialName',
      key: 'realityMaterialName',
      align: 'center'
    }
  ];

  return (
    <PageContent>
      <ul className={styles['card-ul']}>
        <li>
          <span className={styles['li-title']}>{'托盘手动下架'}</span>
        </li>
        <Card>
        <ul className={styles['card-ul']}>
          <li>
            <span className={styles['li-title']}>{item.receiptNumber || ''}</span>
            <span
              className={styles['li-status']}
              style={item.state == 1 ? onGoingStyle : completeStyle}
            >
              {item.state == 1 ? '执行中' : '已完成'}
            </span>
          </li>
          <li>
            <span className={styles['li-next-title']}>采购单号</span>
            <span className={styles['li-next-title']}>{item.purchaseReceiptNumber || ''}</span>
          </li>
          <li>
            <span className={styles['li-next-title']}>供应商</span>
            <span className={styles['li-next-title']}>{item.supplierName || ''}</span>
          </li>
          <li>
            <span className={styles['li-next-title']}>操作人</span>
            <span className={styles['li-next-title']}>{item.operator || ''}</span>
          </li>
          <li>
            <span className={styles['li-next-title']}>实际收货时间</span>
            <span className={styles['li-next-title']}>{item.actualInTime || ''}</span>
          </li>
          <li>
            <span className={styles['li-next-title']}>计划收货时间</span>
            <span className={styles['li-next-title']}>{item.planInTime || ''}</span>
          </li>
          {item.state == 1 && (
            <li className={styles['li-button']}>
              <Button
                fill
                round
                className={classnames(styles['baseButton'], styles['delete-button'])}
                onClick={handleDeleteOrder}
                style={item.state == 1 ? { marginRight: '8px' } : null}
              >
                删除
              </Button>
              <Button
                fill
                round
                className={classnames(styles['baseButton'], styles['confirm-button'])}
                onClick={handleConfirm}
              >
                确认入库
              </Button>
            </li>
          )}
        </ul>

        {/* </CardContent> */}
      </Card>
      </ul>
    </PageContent>
  );
};

export default ManualSheet;
